    render() {
        return (
            <React.Fragment>

            <Helmet>
                <title>LiteCnC</title>
            </Helmet>
                {/* Carousel or slider */}
                <div className='home-container'>
                    <div class="landing-feature">
                       <h1 className='title'>LiteCnC</h1>
                       <div className='body'>
                       <p>This is my favorite card for home page</p> 
                       </div>
                       <div className='home-button'>
                        <button>Book now</button>
                       </div>

                    </div>

                </div>
                {/* Content found on a landing page after slider */}

            </React.Fragment>

        );
    }
}

export default ProductList;
